export function DrawnRectangle({ className, initialFrame = 0 }) {
  const [currentFrame, setCurrentFrame] = useState(initialFrame);

  useEffect(() => {
    // 120ms is roughly 8 frames per second (classic animation speed)
    const interval = setInterval(() => {
      setCurrentFrame((prev) => (prev + 1) % rectangleFrames.length);
    }, 180);

    return () => clearInterval(interval);
  }, []);

  return (
    <div className={cn('relative', className)}>
      {rectangleFrames[currentFrame]}
    </div>
  );
}

