export function DrawnPortrait() {
  const [currentFrame, setCurrentFrame] = useState(0);

  useEffect(() => {
    // 120ms is roughly 8 frames per second (classic animation speed)
    const interval = setInterval(() => {
      setCurrentFrame((prev) => (prev + 1) % portraitFrames.length);
    }, 180);

    return () => clearInterval(interval);
  }, []);

  return <div className="relative">{portraitFrames[currentFrame]}</div>;
}

